import React from "react";
import NavBar from "./navbar";
const AboutUs = ({ navHidden, hideNav, switchNavState }) => {
  return (
    <>
      <NavBar
        color="black"
        active="none"
        navHidden={navHidden}
        hideNav={hideNav}
        switchNavState={switchNavState}
      />
    </>
  );
};

export default AboutUs;
